        throw new OutOfRangeException(index, 0, totalSize);
    }

    final int[] indices = new int[dimension];

    int count = 0;
    for (int i = 0; i < last; i++) {
        int idx = index / uniCounterOffset[i];
        index %= uniCounterOffset[i];
        indices[i] = idx;
    }

    indices[last] = index;

    return indices;
